  `menu_id` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '资源关联菜单',
  `parent_id` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `path` varchar(2000) COLLATE utf8_bin DEFAULT NULL COMMENT '资源树状检索路径',
  `method` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '资源请求类型',
  `description` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '描述',
  `crt_time` datetime DEFAULT NULL,
  `crt_user` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `crt_name` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `crt_host` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `attr1` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `attr2` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `attr3` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `attr4` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `attr5` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `attr6` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `attr7` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `attr8` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `tenant_id` varchar(36) COLLATE utf8_bin DEFAULT NULL COMMENT '租户Id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

