DROP TABLE IF EXISTS `base_tenant`;
CREATE TABLE `base_tenant` (
  `id` varchar(36) COLLATE utf8_bin NOT NULL,
  `code` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '编码',
  `name` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '最后更新时间',
  `crt_user_name` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '创建人',
  `crt_user_id` varchar(36) COLLATE utf8_bin DEFAULT NULL COMMENT '创建人ID',
  `crt_time` datetime DEFAULT NULL COMMENT '创建时间',
  `upd_user_name` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '最后更新人',
  `upd_user_id` varchar(36) COLLATE utf8_bin DEFAULT NULL COMMENT '最后更新人ID',
  `upd_time` datetime DEFAULT NULL COMMENT '最后更新时间',
  `attr1` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `attr2` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `attr3` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `attr4` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `description` varchar(500) COLLATE utf8_bin DEFAULT NULL,
  `is_super_tenant` varchar(1) COLLATE utf8_bin DEFAULT NULL COMMENT '是否超级租户',
  `tenant_id` varchar(36) COLLATE utf8_bin DEFAULT NULL,
  `owner` varchar(36) COLLATE utf8_bin DEFAULT NULL COMMENT '拥有者',
  `is_deleted` char(1) COLLATE utf8_bin DEFAULT '0',
  `is_disabled` char(1) COLLATE utf8_bin DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='租户表';

