  `crt_user_name` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `upd_time` datetime DEFAULT NULL,
  `upd_user_id` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `upd_user_name` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `attr1` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `attr2` varchar(255) COLLATE utf8_bin DEFAULT NULL,
