  `attr4` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `attr5` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `attr6` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `attr7` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `attr8` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `tenant_id` varchar(36) COLLATE utf8_bin DEFAULT NULL COMMENT '租户Id',
  `is_deleted` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '是否删除',
  `is_disabled` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '是否作废',
  `depart_id` varchar(36) COLLATE utf8_bin DEFAULT NULL COMMENT '默认部门',
  `is_super_admin` varchar(1) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`),
